    width: '100%',
    height: '100%',
    objectfit: 'cover'
    }} />
  <div className="card-body">
    <h4 className="card-text">what comes in your mind when you hear wild animals?</h4>
    <p>share us your wonderful thoughts!</p>
    <button type="button" class="btn btn-outline-danger">Click here to share</button>
 
  </div>
  </div>
      </div>
    );

}
export default Home
